import torch

def nll_lorentzian(preds, target, gamma):

    gammasquared = gamma ** 2
    neg_log_p = torch.log(1+((preds - target) ** 2 / (gammasquared)))
    neg_log_p += torch.log(gamma)
    return neg_log_p.sum() / (target.size(0) * target.size(1))

