def lat2txt(lat, fmt='%g'):

    if lat < 0:
        latlabstr = u'%s\N{DEGREE SIGN}S' % fmt
        latlab = latlabstr % abs(lat)
    elif lat > 0:
        latlabstr = u'%s\N{DEGREE SIGN}N' % fmt
        latlab = latlabstr % lat
    else:
        latlabstr = u'%s\N{DEGREE SIGN}' % fmt
        latlab = latlabstr % lat
